	useEffect(() => {
		fetch(`api/62e4c9bf141fd0c331ace5df`)
			.then((res) => {
				res.json();
			})
			.then((data) => {
				console.log(data);
			});
	}, []);
	return <div>Loading...</div>;
}

export default Warehouse;
